import './Navbar.css';
import logo from '../../img/logo.png';

function Navbar(){
  return (
    <div className="Navbar">
      <div className='leftSide'>
        <img className='logo' alt='centerCentre' src={logo} />
      </div>

      <div className='rightSide'>
          <a id='login' className='button' href="">Login</a>
      </div>
    </div>


  );
}

export default Navbar;
